prompt --application/shared_components/logic/application_computations/json_shortcuts
begin
wwv_flow_api.create_flow_computation(
 p_id=>wwv_flow_api.id(27818534962519598054)
,p_computation_sequence=>10
,p_computation_item=>'JSON_SHORTCUTS'
,p_computation_point=>'BEFORE_HEADER'
,p_computation_type=>'FUNCTION_BODY'
,p_computation_processed=>'REPLACE_EXISTING'
,p_computation=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
'  returnClob clob;',
'',
'begin',
'  apex_json.initialize_clob_output;',
'',
'   apex_json.open_array();',
'   for shortcuts_rec in (',
'      select *',
'      FROM apex_collections',
'      WHERE collection_name = ''SHORTCUTS_COLLECTION''',
'      order by n002 asc nulls last, seq_id asc nulls last',
'   )',
'   loop',
'',
'   apex_json.open_object(); --shortcut',
'   ',
'   apex_json.write(''name'', shortcuts_rec.c001);',
'   apex_json.write(''action'', shortcuts_rec.c002);',
'   if shortcuts_rec.n001 is not null then',
'     apex_json.write(''page_id'', shortcuts_rec.n001);',
'   end if;',
'   if shortcuts_rec.c002 = ''url'' then',
'       if shortcuts_rec.c015 = ''&''||''LOGOUT_URL.'' then',
'          apex_json.write(''url'', ''&LOGOUT_URL.'');',
'       else',
'        apex_json.write(''url'', shortcuts_rec.c015);',
'       end if;',
'   elsif shortcuts_rec.c002 = ''item'' then',
'     apex_json.write(''item_name'', shortcuts_rec.c007);',
'     if shortcuts_rec.c008 is not null then',
'        apex_json.write(''item_value'', shortcuts_rec.c008);',
'     end if;',
'   elsif shortcuts_rec.c002 = ''ir'' then',
'     if shortcuts_rec.c009 is not null then',
'        apex_json.write(''IR_static_id'', shortcuts_rec.c009);',
'     end if;',
'     apex_json.write(''IR_type'', shortcuts_rec.c010);',
'     if shortcuts_rec.c010 = ''column'' then',
'        apex_json.write(''IR_column'', shortcuts_rec.c011);',
'     end if;',
'     apex_json.write(''IR_operator'', shortcuts_rec.c012);',
'     if shortcuts_rec.c013 is not null then',
'        apex_json.write(''IR_clearCache'', shortcuts_rec.c013);',
'     end if;',
'     if shortcuts_rec.c014 is not null then',
'        apex_json.write(''IR_value'', shortcuts_rec.c014);',
'     end if;',
'   end if;',
'   if shortcuts_rec.c003 = ''true'' then',
'      apex_json.write(''newWindow'', true);',
'   end if;',
'   if shortcuts_rec.c004 = ''true'' then',
'      apex_json.write(''clearCache'', true);',
'      if shortcuts_rec.c005 is not null then',
'          apex_json.write(''clearCacheList'', shortcuts_rec.c005);',
'      end if;',
'   end if;',
'   if shortcuts_rec.c006 is not null then',
'     apex_json.write(''example'', shortcuts_rec.c006);',
'   end if;',
'   ',
'   apex_json.close_object(); --location',
'   end loop;',
'   apex_json.close_array();',
'   returnClob  := apex_json.get_clob_output;',
'   ',
'   apex_json.free_output;',
'   ',
'   return returnClob ;',
'',
'end;'))
);
end;
